(101, 'Lo schifo!', 0.5, ' Il mare era sempre agitato e il locale nelle foto sembrava piÃ¹ bello', '2016-11-24', 58),
(102, 'Quello che cercavo!', 5, ' Ormai Ã¨ da anni che scelgo questo lido per trascorrere le mie vacanze in Italia. Il posto Ã¨ meraviglioso, il servizio eccellente e il divertimento Ã¨ assicurato', '2016-11-24', 48),
(105, 'ESTERREFATTO', 5, 'Prenotazione facile e veloce in un paradiso terrestre, esattamente quello che ci vuole per trascorrere le ferie in totale tranquillitÃ .', '2016-11-18', 65),
(106, 'Bellissimo!', 4.5, ' Una vacanza stupenda!', '2016-11-09', 63),
(107, 'Spettacolare!', 5, ' Da oggi amo la Calabria e la sua gente', '2016-11-25', 59),
(108, 'OK', 3, ' Non sono delusa, ma mi aspettavo di piÃ¹. Le 3 stelle sono giuste', '2016-11-24', 54);
